import React, { useEffect, useState } from 'react';

const Profile = () => {
    const [loading, setLoading] = useState(true);

    // Simulate an asynchronous operation (e.g., an API call) using useEffect
    useEffect(() => {
        const fetchData = async () => {
            try {
                // Simulate a delay with setTimeout (remove this line in a real application)
                await new Promise((resolve) => setTimeout(resolve, 1000));

                // Set loading to false to indicate that the data has been fetched
                setLoading(false);
            } catch (error) {
                // Handle any errors here
                console.error('An error occurred:', error);
            }
        };

        fetchData();
    }, []);

    return (
        <div>
            <h1>Profile Page</h1>
            {loading ? (
                <p>Loading profile data...</p>
            ) : (
                <>
                    {/* User profile content */}
                    <p>Username: JohnDoe</p>
                    <p>Email: johndoe@example.com</p>
                </>
            )}
        </div>
    );
};

export default Profile;
